import React, {Component} from 'react'
import{Text, View} from 'react-native'

class Login extends Component{
    constructor(props){
        super(props);
        this.setState ={}
    }

    render(){
        return(
            <View>
                <Text>Hola</Text>
            </View>
        )
    }
}

export default Login;
